import React from 'react'

const AttractionSummary = ({attraction}) => {
  return (
    <div className="card z-depth-0">
        <div className="card-content grey-text text-darken-3">
        <span className="card-title">{attraction.Id}</span>
        <p>{ attraction.WaitingTime || attraction.WaitingTime === 0 ? "met een wachttijd van " + attraction.WaitingTime + " minuten!" : null }</p>
        </div>
    </div>
  )
}

export default AttractionSummary
